import React from 'react'
import '../css/footer.css';

const Footer = () => {
  return (
    <div className='footer'>
        <p>CARX Tours | build version: 0.5.9 | closed alpha test</p>
        <p>HTTPS: Последняя стабильная версия</p>
        <p>HTTP: Последняя не стабильная версия</p>
    </div>
  )
}

export default Footer;
